71.source:
layout = {
	name: 'Emiter',
	width: 300,
	elements: [
		{ name: 'count', inputType: 'Number' },
		{ name: 'color', inputType: 'node' },
		{ name: 'opacity', inputType: 'node' },
		{ name: 'position', inputType: 'node' },
		{ name: 'rotation', inputType: 'node' },
		{ name: 'scale', inputType: 'node' }
	]
};

function load() {

	const fireNodeMaterial = new THREE.SpriteNodeMaterial();
	fireNodeMaterial.blending = THREE.AdditiveBlending;
	fireNodeMaterial.transparent = true;
	fireNodeMaterial.depthWrite = false;

	const fireInstancedSprite = new THREE.Mesh( new THREE.PlaneGeometry( 1, 1 ), fireNodeMaterial );
	fireInstancedSprite.isInstancedMesh = true;
	fireInstancedSprite.count = 100;

	return fireInstancedSprite;

}

function main() {

	const mesh = local.get( 'mesh', load );

	if ( mesh ) {

		mesh.count = Math.round( parameters.get( 'count' ) || 1 );

		mesh.material.colorNode = parameters.get( 'color' );
		mesh.material.opacityNode = parameters.get( 'opacity' );
		mesh.material.positionNode = parameters.get( 'position' );
		mesh.material.rotationNode = parameters.get( 'rotation' );
		mesh.material.scaleNode = parameters.get( 'scale' );
		mesh.material.dispose();

	}

	return mesh;

}

